The End is Nigh makes use of many external data files to store important information for the game. Excerpts from these files will be formatted like so: example_code {
some_value
<mark>value_of_importance</mark>
etc
} This is done for similar reasons to variables/data (hence the similar formatting). Furthermore, values of extreme importance, relevant to the current topic, will be highlighted. As can be seen on line 3 of the example code above. When an ellipsis is used in an exerpt from one of the game's many files, it means that there is extra data that has been omitted due to lack of relevance. This allows readers to see that what is being shown is only a small section of a larger piece of data. When an ellipsis is used in a piece of examply syntax it means that the data can carry on after what is being shown, representing that the variable can take multiple values.

60.body:
Location in the unpacked data: data\tilesets.txt The tilesets file is one of the most important when modding TEIN, especially in regards to adding new areas/zones. The file dictates general information about a given area, but also defines many of the traits and aspects that will make an area unique (graphical elements, what music to use, palette, etc.). Here is an example tileset taken from the game, ("The End" downward secret area tileset): 1xd { #1 bonus downward areas area_name "The End" area_label_frame 1 tile_graphics Tilecity overlay_graphics Overlayscity background_graphics bg2 palette 1 fx_shader reflectionripples music [**hmk_secret_intro.ogg, hmk_secret_loop.ogg**] ambience rain.ogg stop_previous_music false music_volume 1 ambience_volume 1 area_type normal tile_particle_1 drip npc_1 NPCD6 npc_2 NPC0 npc_3 none
} Whilst this may seem complex, the syntax for a tileset can be broken down and represented as the following: [**TILESET_NAME**] { [**VARIABLE_NAME**] [VALUE] ...
} The # followed by text, in The End example, is simply a comment and not interpreted/read by the game itself, hence why it was not added in the simplified syntax breakdown. So, overall, the "tilesets.txt" file simply stores a series of tilesets that define properties, features, and aspects of the different zones in the game. Allowing for them to make use of different assets, music, NPCs, alternate graphics, particles, etc.
